import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import YieldForm from "./pages/Yie";
import HistoryPage from "./pages/HistoryPage";

function App() {
  return (
    <Router>
      <nav style={navStyle}>
        <h2>ðŸŒ¾ AI Crop Yield App</h2>
        <div>
          <Link to="/" style={linkStyle}>
            Predict Yield
          </Link>
          <Link to="/history" style={linkStyle}>
            History
          </Link>
        </div>
      </nav>

      <Routes>
        <Route path="/" element={<YieldForm />} />
        <Route path="/history" element={<HistoryPage />} />
      </Routes>
    </Router>
  );
}

const navStyle = {
  display: "flex",
  justifyContent: "space-between",
  alignItems: "center",
  backgroundColor: "#4CAF50",
  color: "white",
  padding: "10px 20px",
};

const linkStyle = {
  color: "white",
  marginLeft: "20px",
  textDecoration: "none",
  fontWeight: "bold",
};

export default App;
